import { useState } from 'react'


const Search = () => {

    const [tasks, setTasks] = useState([
        {
            id : 1,
            title : 'Riafy'
        },
        {
            id : 2,
            title : 'Webleks'
        },
        {
            id : 3,
            title : 'Ovalion'
        },
        {
            id : 4,
            title : 'Ewokesoft'
        },
    ])

    return (
        <>
          {
              tasks.map((task) => (
                  <h3>{task.title}</h3>
              ))
          }  
        </>
    )
}

export default Search
